><title
>titel</title
><style type='text/css'
><![CDATA[
/* general styles */body {	background: #FFFFFF;	font: 100% Arial, Helvetica, sans-serif;	color: #404040;	line-height: 110%;	margin: 0;}p {	background: #FFFFFF;	font: 100% Arial, Helvetica, sans-serif;	color: #202020;	line-height: 110%;	text-align: left;}/***********************div classes************************/div.head {	font: 200% Arial, Helvetica, sans-serif, bold;	text-align: center;	width: 100%;	position: fixed;	top: 0px;	height: 90px;	background: #FFFFFF;	z-index: 99;}div.lefttoc {	position: fixed;	width: 20%;	/*height:90%;*/	top: 100px;	left: 5px;	bottom: 20px;	border: solid 1px #000000;	overflow: auto;	white-space: nowrap;	/*display:none;*/ /*uncomment on the left for printing*/}div.middle {	position: relative;	margin: 100px 160px 0 23%; /*top right bottom left */	/* margin: x y   =  Xpx each - botten and top,   ypx each - left and right */}div.righttoc {	position: fixed;	width: 150px;	top: 100px;	right: 5px;	border: solid 1px #000000;	/*display:none;*/ /*uncomment on the left for printing*/}button {	width: 100%;}/*code light-blue*/pre {	font-family: courier;	background: #E5F1F4;	font-size: 80%;	border: 1px dotted;	line-height: 110%;	color: #000000;	white-space: pre-wrap;	word-wrap: break-word;}.code0 {	background: #E5F1F4;}/*code red-brown*/.code1 {	background: #A66C75;}/*code light-green*/.code2 {	background: #DAF1DD;}/*code light-yellow*/.code3 {	background: #F5F2B7;}/*default highlight yellow*/span {	background: #FFFF00;}/*red*/span.r {	background: #FF0000;}/*green*/span.g {	background: #00FF00;}/*blue*/span.b {	background: #00FFFF;}a {	text-decoration: none;	color: #057fac;}a:hover {	text-decoration: none;	color: #999999;}h1 {	font-size: 140%;	margin: 20px 0px;}h2 {	font-size: 120%;}/* work-around for margin/padding issues with hash-tag links *//* http://css-tricks.com/hash-tag-links-padding/             */h1:before {	font-size: 140%;	display: block;	content: " ";	margin-top: -100px;	height: 100px;	visibility: hidden;}h2:before {	font-size: 120%;	display: block;	content: " ";	margin-top: -100px;	height: 100px;	visibility: hidden;}h3:before {	display: block;	content: " ";	margin-top: -100px;	height: 100px;	visibility: hidden;}/*End of work-around*/form {	margin: 1em 0;	padding: .2em 20px;	background: #eeeeee;}
]]></style
><style type='text/css' media='print'
><![CDATA[
/* special css file for media=print, to hide and change some elements *//* this is additive to the style_template.css *//***********************change positions to absolute to avoid printing the title and tableof contents on every page. Remove the Quicklink toc on the right.Make toc on the left floating on top of middle div.************************/div.head {	position: absolute;}div.lefttoc {	position: relative;	width: 100%;	/*height:90%;*/	top: 100px;	left: 30px;	right: 30px;	bottom: auto;	border: none;	margin-bottom: 200px;	overflow: visible;}div.middle {	position: relative;	margin: 100px 30px 0 20px; /*top right bottom left */	/* margin: x y   =  Xpx each - botten and top,   ypx each - left and right */}div.righttoc {	display: none;}
]]></style
